      "sourcesContent": ["/* You can add global styles to this file, and also import other style files */\n:root {\n    --fondo: #f1f1f1; \n}\nbody {\n    font-family: 'Raleway', sans-serif;\n    background: var(--fondo);\n    margin: 0;\n    position: relative;\n}\nh1 {\n    font-family: 'MuseoModerno', cursive;\n    border-bottom: 1px solid;\n    font-size: 30px;\n}\n.logo {\n    font-family: 'MuseoModerno', cursive;\n    font-size: 24px;\n    transition: color 400ms, transform 400ms;\n}\n/* Barra de navegación */\nheader {\n    width: calc(100% - 20px);\n    background: #d40303;\n    padding: 20px 10px;\n    position: sticky;\n    display: block;\n    top: 0;\n    text-transform: uppercase;\n}\nheader ul {\n    margin: 0 auto;\n    list-style: none;\n    display: flex;\n    flex-wrap: wrap;\n    padding: 0;\n    max-width: 1100px;\n}\nheader ul li {\n    width: max-content;\n    max-width: calc(20% - 20px);\n    display: block;\n    margin: auto;\n}\nheader ul a {\n    color: white;\n    text-decoration: none;\n    padding: 10px;\n    transition: all 30ms;\n}\nheader ul a:hover, header ul a.actived {\n    background: #bb0303;\n}\nheader li.logo a:hover {\n    background: transparent;\n}\n/* Contenedor principal */\n#content {\n    width: calc(100% - 40px);\n    margin: 0 auto;\n    max-width: 1100px;\n    padding: 20px;\n    background: white;\n}\n/* Pié de página*/\nfooter {\n    width: calc(100% - 40px);\n    margin: 0 auto;\n    max-width: 1100px;\n    padding: 10px 20px;\n    background: var(--fondo);\n}\n/* Sobre mi */\narticle {\n    text-align: justify;\n}\n/* Crear proyecto */\nform p {\n    display: flex;\n    flex-direction: column;\n}\n\nform p label {\n    margin: 10px 0;\n}\n\nform p input {\n    width: 100%;\n    height: 20px;\n}\n\nform {\n    max-width: 400px;\n    width: 100%;\n}\n\nform p input[type=\"submit\"] {\n    width: max-content;\n    max-width: 250px;\n    margin: auto;\n    padding: 10px;\n    background: #d40303;\n    color: white;\n    text-transform: uppercase;\n    border: 0;\n    border-radius: 25px;\n    height: auto;\n    cursor: pointer;\n    outline: none;\n}\n\nform p input[type=\"submit\"]:hover {\n    background: #bb0303;\n}\n\nform p span {\n    margin: 5px 0;\n    color: red;\n    font-size: 14px;\n}\n\nform p input[disabled] {\n    background: #ccc;\n    cursor: not-allowed;\n}\n\n.success {\n    padding: 10px;\n    background: #2f982f;\n    color: white;\n    max-width: 380px;\n    width: 100%;\n}\n\n.success a {\n    color: white;\n    font-weight: 900;\n}\n\n.failed {\n    padding: 10px;\n    background: red;\n    color: white;\n    max-width: 380px;\n    width: 100%;\n}\n\n/* Página de proyectos */\n.container {\n    width: 100%;\n}\n\n.container ul {\n    width: 100%;\n    display: flex;\n    flex-wrap: wrap;\n    list-style: none;\n    padding: 0;\n}\n\n.container ul li {\n    width: 30%;\n    margin: 20px 1% auto 2%;\n}\n\n.pryecto {\n    width: 100%;\n    display: flex;\n    flex-wrap: wrap;\n}\n\nimg {\n    max-width: 100%;\n    display: block;\n    margin: 0 auto;\n}\n\n.proyecto img {\n    max-height: 400px;\n}\n\n.proyecto-link {\n    text-decoration: none;\n    color: black;\n}\n\n/* Página detalles proyecto */\n\na.button-edit {\n    background: aquamarine;\n    padding: 10px 15px;\n    color: black;\n    text-decoration: none;\n    margin: 30px;\n    cursor: pointer;\n}\n\na.button-delete {\n    background: #d40303;\n    padding: 10px 15px;\n    color: white;\n    text-decoration: none;\n    margin: 30px;\n    cursor: pointer;\n}\n\n.pagina.proyecto {\n    display: flex;\n    flex-wrap: wrap;\n}\n\n.pagina.proyecto h2 {\n    width: 100%;\n}\n\n.pagina.proyecto img {\n    max-height: 500px;\n}\n\n.pagina.proyecto .category {\n    width: 100%;\n    margin: 10px auto;\n}\n\n.pagina.proyecto .year {\n    width: 100%;\n    margin: 10px auto;\n}\n\n.pagina.proyecto .langs {\n    width: 100%;\n    margin: 10px auto;\n}\n\n.pagina.proyecto div {\n    display: flex;\n    width: 100%;\n    flex-wrap: wrap;\n}\n\n/* Owl Cariusel */\n\n.owl-carousel .owl-item img {\n    width: auto !important;\n}"]
